import React, { Component } from 'react';
import './App.css';
import HeaderRouteManager from '../components/navigation/header/HeaderRouteManager';
import FooterRouteManager from '../components/navigation/footer/FooterRouteManager';
import Routes from '../components/Routes/Routes';
import {BrowserRouter as Router} from 'react-router-dom';

class App extends Component {
  constructor(props) {
    super(props);
  }

state = {
  isClicked: false
}

  changeClickStatus = () => {
  const buttonClicked = this.state.isClicked;
  this.setState({isClicked: !buttonClicked});
};

 render () {


  return( 
    <div className = {'App'}>
      <Router>
          <HeaderRouteManager
          isClicked = {this.state.isClicked}
          click = {this.changeClickStatus}
          />
          <Routes/>
          <FooterRouteManager/>
      </Router> 
    </div>
  );
}
}

export default (App);
